function stringtoarray(s){
    return [parseInt(s.substring(0,2))*10,
            parseInt(s.substring(2,4))*10,
            parseInt(s.substring(4,6))*10]
}

function isIn(a,b){ //specifically used for winData
    for(var i=0;i<a.length;i++){
        if(a[i][0]==b[0] && a[i][1]==b[1]){
            return true;
        }
    }
    return false;
}

function getDatafromImage(x,y,image){
    switch(image){
        case "globe":
            var temp=4*(Math.floor(y*globeHeight)*globeWidth+Math.floor(x*globeWidth));
            var temp1=6*parseInt(globeData.substring(temp,temp+4));
            return stringtoarray(globeRef.substring(temp1,temp1+6));            
            break;
        case "win":
            //alert([x,y,isIn(winData,[x,y])]);
            return isIn(winData,[x,y]);
            //return winData.includes([x,y]);
    }
}